by_room.map:
function (doc) {
  if (doc.doc_type === 'message') {
    emit(doc.room_id, {_id: doc.user_id})
    emit(doc.room_id, doc)
  }
}

by_token.map:
function (doc) {
  if (doc.doc_type === 'room') {
    for (var i = 0; i < doc.join_tokens.length; i++) {
      emit(doc.join_tokens[i].token, doc);
    }
  }
}
